import{_ as e,c as a,o as t,U as r}from"./chunks/framework.FhXPyWfz.js";const m=JSON.parse('{"title":"UIFlycode概述","description":"","frontmatter":{"title":"UIFlycode概述","date":"2020-05-18T17:21:53.000Z"},"headers":[],"relativePath":"doc/wpdoc/UIFlycode概述.md","filePath":"doc/wpdoc/UIFlycode概述.md"}'),o={name:"doc/wpdoc/UIFlycode概述.md"},l=r('<h1 id="uiflycode" tabindex="-1">UIFlycode <a class="header-anchor" href="#uiflycode" aria-label="Permalink to &quot;UIFlycode&quot;">​</a></h1><p>UIFlycode使用面向对象的设计思想，使用UI对象的属性或方法，对UI元素进行操控；</p><p>同时UIFlycode还提供一些常用的前端服务，如数据请求，定位等，方便进行灵活的业务配置。</p><h2 id="page-表单对象" tabindex="-1">Page 表单对象 <a class="header-anchor" href="#page-表单对象" aria-label="Permalink to &quot;Page 表单对象&quot;">​</a></h2><p>表单对象，用于对单个表单进行数据存取，UI控制，以及事件调用等，请参看<a href="http://apaas.wxchina.com:8881/technology/122/" title="表单对象" target="_blank" rel="noreferrer">【表单对象】</a></p><p>对于流程表单，提供了一个专门的流程表单对象，用于专门处理流程相关的信息和操作，请参看【流程表单对象】。</p><h2 id="ctrl-控件对象" tabindex="-1">Ctrl 控件对象 <a class="header-anchor" href="#ctrl-控件对象" aria-label="Permalink to &quot;Ctrl 控件对象&quot;">​</a></h2><p>控件对象用于对单个控件进行数据存取，UI控制等，请参看<a href="http://apaas.wxchina.com:8881/technology/106/" target="_blank" rel="noreferrer">【控件对象】</a></p><p>对于特殊类型的控件，还提供了针对其特点进行的操作，例如<a href="http://apaas.wxchina.com:8881/technology/118/" target="_blank" rel="noreferrer">【选项控件对象】</a>和<a href="http://apaas.wxchina.com:8881/technology/112/" title="【数组控件对象】" target="_blank" rel="noreferrer">【数组控件对象】</a>。</p><p>对于SectionList，还提供了一套特有的较为复杂的操作，请参看 【分组列表对象】。</p><p>由于控件的复杂性，还提供一组辅助对象，帮助在特定场景下对控件进行操作，例如索引，行，取值，赋值等，请参看【控件辅助对象】。</p><h2 id="model-模型对象" tabindex="-1">Model 模型对象 <a class="header-anchor" href="#model-模型对象" aria-label="Permalink to &quot;Model 模型对象&quot;">​</a></h2><p>模型对象，用于调用业务模型的相关接口，进而实现数据的存取，请参看<a href="http://apaas.wxchina.com:8881/technology/121/" title="【模型对象】" target="_blank" rel="noreferrer">【模型对象】</a>。</p><p>对于移动端，还提供了离线数据模型对象的操作，请参看【离线模型对象】。</p><p>除了业务模型，还提供了专门针对报表的【报表模型对象】，用于报表数据的处理。</p><h2 id="其他对象" tabindex="-1">其他对象 <a class="header-anchor" href="#其他对象" aria-label="Permalink to &quot;其他对象&quot;">​</a></h2><p>UIFlycode还提供一些常用的前端服务，如数据请求，定位等，方便进行灵活的业务配置。</p><p>请参看<a href="http://http://apaas.wxchina.com:8881/technology/124/" title="【位置对象】" target="_blank" rel="noreferrer">【位置对象】</a>，<a href="http://apaas.wxchina.com:8881/technology/123/" title="【系统对象】" target="_blank" rel="noreferrer">【系统对象】</a>。</p><h1 id="关于枚举对象的说明" tabindex="-1">关于枚举对象的说明 <a class="header-anchor" href="#关于枚举对象的说明" aria-label="Permalink to &quot;关于枚举对象的说明&quot;">​</a></h1><p>目前所有的UIFlycode的内置枚举类型，都支持直接使用字符串进行存取和对比。</p>',20),c=[l];function h(n,p,d,i,s,_){return t(),a("div",null,c)}const y=e(o,[["render",h]]);export{m as __pageData,y as default};
